import React from 'react';
import Link from 'next/link'

const Navegacion = () => {
    return ( 
        <nav>
            <Link href = "/index">Index</Link>
            <Link href = "/Medicinales">Index</Link>
            <Link href = "/Alimentos">Index</Link>
            <Link href = "/Decorativas">Index</Link>
        </nav>
     );
}

 
export default Navegacion;
